trans-unit.note:
@FreeCAD Use + or - on the right to show that you think a translation is a good one (+) or a bad one (-).

I normally use only the "up-votes" (+) but if a translation is definitely wrong I would use the "down-vote" (-).

The number in front of + and - shows the difference of up- and down-votes. 0 indicates that either no one voted yet or that a translation received the same amount of up- and down-votes.

